BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "bank" (
	"bank_account_number"	VARCHAR,
	"bank_account_name"	VARCHAR,
	"bank_name"	VARCHAR(45),
	"bank_pic"	TEXT,
	PRIMARY KEY("bank_account_number")
);
CREATE TABLE IF NOT EXISTS "bill" (
	"bill_id"	VARCHAR,
	"room_id"	VARCHAR,
	"contract_id"	VARCHAR,
	"month"	VARCHAR(11),
	"rent_fee"	DECIMAL,
	"water_bill"	DECIMAL,
	"electricity_bill"	DECIMAL,
	"additional_expenses"	DECIMAL,
	"fine"	DECIMAL,
	PRIMARY KEY("bill_id"),
	FOREIGN KEY("contract_id") REFERENCES "contract"("contract_id") ON DELETE CASCADE,
	FOREIGN KEY("room_id") REFERENCES "room"("room_id") ON DELETE CASCADE
);
CREATE TABLE IF NOT EXISTS "contact" (
	"contact_id"	VARCHAR,
	"tenant_ID"	VARCHAR,
	"topic"	VARCHAR(255),
	"description"	TEXT,
	"picture"	BLOB,
	"date"	DATETIME,
	"response_time"	DATETIME,
	"status"	VARCHAR(10),
	"response"	TEXT,
	PRIMARY KEY("contact_id"),
	FOREIGN KEY("tenant_ID") REFERENCES "tenant"("tenant_ID") ON DELETE CASCADE
);
CREATE TABLE IF NOT EXISTS "contract" (
	"contract_id"	VARCHAR(20),
	"tenantFirstName"	VARCHAR(30),
	"tenantLastName"	VARCHAR(30),
	"dormitory_id"	VARCHAR(20),
	"floor_number"	INT,
	"room_id"	VARCHAR(20),
	"user_citizen_id"	VARCHAR(20),
	"user_address"	VARCHAR(255),
	"contract_start_date"	DATE,
	"contract_end_date"	DATE,
	"contract_month"	INT,
	"rent_fee"	DECIMAL(10, 2),
	"warranty"	DECIMAL(10, 2),
	"electric_meter_number"	VARCHAR(50),
	"water_meter_number"	VARCHAR(50),
	"electric_per_unit"	DECIMAL(10, 2),
	"water_per_unit"	DECIMAL(10, 2),
	"extra_condition"	TEXT,
	PRIMARY KEY("contract_id"),
	FOREIGN KEY("dormitory_id") REFERENCES "dormitory"("dormitory_id"),
	FOREIGN KEY("room_id") REFERENCES "room"("room_id")
);
CREATE TABLE IF NOT EXISTS "dormitory" (
	"dormitory_id"	VARCHAR,
	"dormitory_name"	VARCHAR(50),
	"owner_id"	VARCHAR,
	"contact"	VARCHAR(10),
	"email"	VARCHAR(50),
	"monthly_bill_date"	INT,
	"bill_due_date"	INT,
	"floor_count"	INT,
	"dorm_address"	VARCHAR(255),
	"province"	VARCHAR(50),
	"subdistrict"	VARCHAR(50),
	"district"	VARCHAR(50),
	"zip_code"	VARCHAR(5),
	PRIMARY KEY("dormitory_id"),
	FOREIGN KEY("owner_id") REFERENCES "owners"("owner_id") ON DELETE CASCADE
);
CREATE TABLE IF NOT EXISTS "dormitory_floors" (
	"dormitory_id"	VARCHAR,
	"floor_number"	INT,
	"room_amount"	INT,
	PRIMARY KEY("dormitory_id","floor_number"),
	FOREIGN KEY("dormitory_id") REFERENCES "dormitory"("dormitory_id")
);
CREATE TABLE IF NOT EXISTS "dormitory_info" (
	"dormitory_id"	VARCHAR,
	"information"	TEXT,
	"dorm_pic"	BLOB,
	FOREIGN KEY("dormitory_id") REFERENCES "dormitory"("dormitory_id") ON DELETE CASCADE
);
CREATE TABLE IF NOT EXISTS "facilities" (
	"facilityID"	VARCHAR,
	"dormitory_id"	VARCHAR,
	"facility"	VARCHAR(100),
	PRIMARY KEY("facilityID"),
	FOREIGN KEY("dormitory_id") REFERENCES "dormitory"("dormitory_id") ON DELETE CASCADE
);
CREATE TABLE IF NOT EXISTS "owners" (
	"owner_id"	VARCHAR,
	"owner_username"	VARCHAR,
	"owner_password"	VARCHAR(255),
	PRIMARY KEY("owner_id")
);
CREATE TABLE IF NOT EXISTS "payment" (
	"payment_id"	VARCHAR,
	"room_id"	VARCHAR,
	"tenant_ID"	VARCHAR,
	"bill_id"	VARCHAR,
	"bill_status"	VARCHAR(20),
	"payment_due_date"	DATE,
	"receipt_pic"	BLOB,
	PRIMARY KEY("payment_id"),
	FOREIGN KEY("bill_id") REFERENCES "bill"("bill_id") ON DELETE CASCADE,
	FOREIGN KEY("room_id") REFERENCES "room"("room_id") ON DELETE CASCADE,
	FOREIGN KEY("tenant_ID") REFERENCES "tenant"("tenant_ID") ON DELETE CASCADE
);
CREATE TABLE IF NOT EXISTS "room" (
	"room_id"	VARCHAR,
	"dormitory_id"	VARCHAR,
	"room_type_id"	VARCHAR,
	"tenant_ID"	VARCHAR,
	"floor_number"	INTEGER,
	PRIMARY KEY("room_id"),
	FOREIGN KEY("dormitory_id") REFERENCES "dormitory"("dormitory_id") ON DELETE CASCADE,
	FOREIGN KEY("tenant_ID") REFERENCES "tenant"("tenant_ID") ON DELETE CASCADE
);
CREATE TABLE IF NOT EXISTS "room_type" (
	"room_type_id"	VARCHAR,
	"room_type_name"	VARCHAR(50),
	"price"	DECIMAL,
	PRIMARY KEY("room_type_id")
);
CREATE TABLE IF NOT EXISTS "tenant" (
	"tenant_ID"	VARCHAR,
	"tenant_username"	VARCHAR,
	"tenant_password"	VARCHAR(255),
	"firstName"	VARCHAR(30),
	"lastName"	VARCHAR(30),
	"telephone"	VARCHAR(10),
	"email"	VARCHAR(35),
	PRIMARY KEY("tenant_ID")
);
CREATE TABLE IF NOT EXISTS "tenant_status" (
	"tenant_ID"	VARCHAR,
	"room_status"	VARCHAR(30),
	"tenant_status"	VARCHAR(30),
	"bill_status"	VARCHAR(20),
	"tenant_picture"	BLOB,
	PRIMARY KEY("tenant_ID"),
	FOREIGN KEY("tenant_ID") REFERENCES "tenant"("tenant_ID") ON DELETE CASCADE
);
